import React from 'react'
import { useEffect } from 'react'
import { useState } from 'react'
import axios from 'axios'

const book = () => {
    const [book,setBook] = useState([])

    useEffect(()=>{
        const fetchAll = async ()=>{
            try{
                const res = await axios.get("http://localhost:8800/book")
                setBook[res.data]
            }catch(err){
                console.log(err)
            }
        }
        fetchAll()
    },[])

    return (
        <div>Book</div>
    )
}

export default book
